import * as React from 'react';
import { styled } from '@mui/material/styles';
import Grid from '@mui/material/Grid';
import Paper from '@mui/material/Paper';
import Box from '@mui/material/Box';
import imagen from'../static/images/cards/portfolio.jpg'



const proyectos = [
    {
      id: 1,
      nombre: 'Proyecto 1',
      descripcion: 'Descripción del proyecto 1',
      ima: '../static/images/cards/portfolio.jpg'
    },
    {
      id: 2,
      nombre: 'Proyecto 2',
      descripcion: 'Descripción del proyecto 2',
      ima: imagen
    },
    // Agregar más proyectos si es necesario
  ];

const Item = styled(Paper)(({ theme }) => ({
  backgroundColor: theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
  ...theme.typography.body2,
  padding: theme.spacing(1),
  textAlign: 'center',
  color: theme.palette.text.secondary,
}));

export default function RowAndColumnSpacing() {
  return (
    <Box sx={{ width: '50%' }}>
      <Grid container height="100" columnSpacing={{ xs: 1, sm: 2, md: 3 }}>
        <Grid item xs={100}>
          <Item>
          {proyectos.map((proyecto) => (
            <img src={proyecto.imagen} height="20" width="20"></img>
          ))}
            
          </Item>
        </Grid>

      </Grid>
    </Box>
  );
}
